import './App.css';

function App() {
  return (
    <div className="App">
     <nav>
      <div className="navbar">
        <ul>
          <li>Home</li>
          <li><a>Products</a></li>
          <li><a>Shop</a></li>
          <li><a>About</a></li>
          <li><a>Contacts</a></li>
        </ul>
      </div>
     </nav>
    </div>
  );
}

export default App;
